import React from 'react'
import styled from 'styled-components'

const Room = (props) => {
    return (
        <RoomContainer onClick={() => props.setActiveChat(props.name)}>
            {props.name}
        </RoomContainer>
    )
};

export default Room;

const RoomContainer = styled.div`
    width: 100%;
    height: 4rem;
    box-sizing: border-box;
    border: 1px solid black;
`
